import React from "react";
import explicit from "./explicit.png";
import "./tracks.css";
import { Overlay, OverlayTrigger, Popover, Button } from "react-bootstrap";
export default function TrackSearchResult({ num, track, chooseTrack }) {
  function handlePlay() {
    chooseTrack(track);
  }
  //console.log(artist);
  return (
    <div>
      <div
        className="d-flex m-2 align-items-center hover-zoom "
        id="tracks"
        style={{ cursor: "pointer" }}
        onClick={handlePlay}
      >
        {" "}
        <div className="m-2">{track.rank}</div>
        <img
          src={track.art}
          className="m-2"
          style={{ height: "64px", width: "64px" }}
        />
        <div id="trackDetails" className="m-2">
          <div>
            {track.name}{" "}
            {track.explicit ? (
              <img
                src={explicit}
                style={{ height: "16px", width: "16px" }}
              ></img>
            ) : (
              " "
            )}
          </div>
          <div className="text-muted">{track.albumName}</div>
          <div className="text-muted">{"Released: " + track.release}</div>
          {/* <div className="text-muted">{track.artist}</div> */}
        </div>
      </div>
      <div>
        <OverlayTrigger
          trigger="click"
          key={"right"}
          placement={"right"}
          overlay={
            <Popover id={`popover-positioned-${"right"}`}>
              <Popover.Header as="h3">{`Popover ${"right"}`}</Popover.Header>
              <Popover.Body>
                <strong>Holy guacamole!</strong> Check this info.
              </Popover.Body>
            </Popover>
          }
        >
          <Button variant="secondary">Popover on {"right"}</Button>
        </OverlayTrigger>
      </div>
    </div>
  );
}
